        classes: 'nav-item',
        icon: 'profile'
      },
      {
        id: 'test',
        title: 'test',
        type: 'item',
        url: '/test',
        classes: 'nav-item',
        icon: 'user'
      },
      {
        id: 'sample-page',
        title: 'Sample Page',
        type: 'item',
        url: '/sample-page',
        classes: 'nav-item',
        icon: 'chrome'
      },
      {
        id: 'document',
        title: 'Document',
        type: 'item',
        classes: 'nav-item',
        url: 'https://codedthemes.gitbook.io/mantis-angular/',
        icon: 'question',
        target: true,
        external: true
      }
    ]
  },
  // {
